Greetings,

BAI (Blat Auto Install) is a simple console program.

It will facilitate a default Blat install;  &lt;a href=&quot;
http://blat.net&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://blat.net&lt;/a&gt;
Blat help; &lt;a href=&quot;
http://tech.groups.yahoo.com/group/blat/&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://tech.groups.yahoo.com/group/blat/&lt;/a&gt;
More Blat files; &lt;a href=&quot;
http://tech.groups.yahoo.com/group/blat/files/Other/&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://tech.groups.yahoo.com/group/blat/files/Other/&lt;/a&gt;

Double click on bai.exe to run. Follow the on 
screen prompts.

BAI currently supports Outlook and Outlook Express.
If both are found it will install from Outlook.

BAI.exe is self contained. No other files are required.

The source folder has the files needed to run bai.pl.

Namtog
